Underworld.Trilogy

Underworld is a series of vampire/werewolf films directed by Len Wiseman and Patrick Tatopoulos. The first film, Underworld, was released in 2003, and the second film, Underworld: Evolution, was released in 2006. A prequel, Underworld: Rise of the Lycans, was released on January 23, 2009. A fourth film, Underworld: Awakening, is in post-production for 2012 release.
